import React from 'react';
import { FieldValues, UseFormRegister } from 'react-hook-form';

interface InputProps {
    placeholder: string;
    type: string;
    error?: string;
    register: UseFormRegister<FieldValues>
}

const InputModel: React.FC<InputProps> = ({ placeholder, type, error, register }) => {


    
    return (

        <div className="my-10">
            <input
                {...register(type, {required: true})}
                placeholder={placeholder}
                type={type}
                className="p-5 w-full bg-slate-100 rounded-xl placeholder:text-lg"
           
                
            />
            {error && <div className="flex items-center">{error}</div>} 

        </div>
    );
};

export default InputModel;
